const FeatureSection = () => {
  return (
    <section className="feature-section">
      <h2>このサービスの特徴</h2>
      <ul>
        <li>簡単に案件を探せる</li>
        <li>応募もワンクリックで可能</li>
        <li>無料で利用できる</li>
      </ul>
    </section>
  );
};

export default FeatureSection;
